StimulsoftHelper.prototype.setLanguage = function(language) {
  this._currentLanguage = language;
  this.overrideMethods();
};

StimulsoftHelper.prototype.getLocalization = function() {
  if (this._currentLanguage == this._ptBrValue) {
    return this.getLocalizationInfo('Portuguese (Brazil)', this._ptBr);
  }
  else {
    return this.getLocalizationInfo('English', this._enUs);
  }
};

//Função para retornar parametros da mesma forma que a tela de parametros espera (com os mesmos tipos)
StimulsoftHelper.prototype.parseToGroupedParam = function(datasourcesParam) {
  var parameters = [];
  datasourcesParam.forEach(function(dsp) {
    var fieldParams = dsp.fieldParams.toArray();
    fieldParams.forEach(function(fp) {
      if (fp.value == '') {
        for (var type in this._groupedType) {
          if (this._groupedType[type].types.contains(fp.type.toLowerCase())) {
            parameters.push({
              name: fp.param,
              originalName: fp.param,
              type: type,
              value: fp.value
            });
            break;
          }
        }
      }
    }.bind(this));
  }.bind(this));
  var grouped = [];
  parameters.forEach(function(p) {
    var exist = false;
    grouped.forEach(function(g) {
      if (g.name == p.name)
        exist = true;
    });
    if (!exist)
      grouped.push(p);
  });

  return grouped;
};

StimulsoftHelper.prototype.getLocalizationInfo = function (cultureName, xml) {
  return {
    cultureName: cultureName,
    xml: xml
  };
};

StimulsoftHelper.prototype.getKey = function() {
  return this._key;
};

StimulsoftHelper.prototype.nomenclaturePattern = function(value) {
  if (value)
    value = value.replaceAll(".","_").replaceAll(" ", "_");
  return value;
};

StimulsoftHelper.prototype.findDatasourceByName = function(dataSources, name) {

  var datasource = null;

  for (var i = 0; i < dataSources.list.length; i++) {
    var ds = dataSources.list[i];
    if (ds.name == name) {
      datasource = ds;
      break;
    }
  }

  return datasource;
};

StimulsoftHelper.prototype.getDateOnValue = function(date) {
  if (date instanceof Date) {
    return date.toISOString();
  }
  else if (date.indexOf('/')) {
    var groups = date.split(' ');
    var dayMonthYear = groups[0].split('/');
    var hourMinSec = groups.length > 1 && groups[1].length > 0 ? groups[1] : '00:00:00';

    var result = '';
    if (this._currentLanguage == this._ptBrValue)
      result = dayMonthYear[2] + '-' + dayMonthYear[1] + '-' + dayMonthYear[0] + 'T' + hourMinSec;
    else
      result =  dayMonthYear[2] + '-' +  dayMonthYear[0] + '-' + dayMonthYear[1] + 'T' + hourMinSec;
    return result;
  }
  else {
    return date;
  }
};

StimulsoftHelper.prototype.getDate = function(date, type) {
  try {

    if (type == 'odata') {
      var result = this.getDateOnValue(date);
      return "datetimeoffset'"+result+"'";
    }
    else {
      return this.getDateOnValue(date);
    }
  }
  catch(e) {
    return date;
  }
};

StimulsoftHelper.prototype.adjustParam = function(param, type) {

  try { param.value = JSON.parse(param.value); } catch(e) {}

  if (param.type.startsWith('Date') || ( typeof param.value == 'string' && param.value.match(this._datePattern) )) {
    return this.getDate(param.value, type);
  }
  else if (type == 'odata') {
    if (param.type == 'String') {
      return "'" + param.value +"'";
    }
    else if (typeof param.value == 'string' && param.value.match(this._isoPattern)) {
      return "datetimeoffset'" + param.value +"'";
    }
  }
  else {
    if (param.value instanceof Date) {
      return param.value.toISOString();
    }
  }
  return param.value;
};

StimulsoftHelper.prototype.resetRegex = function() {
  this._regexForParam.lastIndex = -1;
};

StimulsoftHelper.prototype.dataSourceHasParam = function(datasource) {
  this.resetRegex();
  return this._regexForParam.exec(datasource.sqlCommand) != null;
};

StimulsoftHelper.prototype.getParamsFromFilter = function(datasource) {
  var linkParameters = this.manageLinkParameters('get', datasource);
  var result = [];

  if (linkParameters.length > 0)
    result = this.buildParamsWithValue(JSON.parse(linkParameters));

  result.forEach(function(r) {
    var column = this.getColumnByName(datasource, r.field);
    var type = column ? column.type.getStiTypeName() : 'String';
    r.type = type;
  }.bind(this));

  return result;
};

StimulsoftHelper.prototype.buildParamsWithValue = function(data) {
  var result = [];
  if (data.params) {
    data.params.forEach(function(p) {
      result.push({
        field: p.fieldName,
        param: p.fieldValue.startsWith(':') ? p.fieldValue.substr(1) : p.fieldName,
        value: p.fieldValue.startsWith(':') ? '' : p.fieldValue
      });
    }.bind(this));
  }

  var expression;
  if (data.expression)
    expression = data.expression;
  else
    expression = data;

  var addParamToResult = function(exp) {
    for (var i = 0; i < exp.args.length; i++) {
      var arg = exp.args[i];
      if (arg.args && arg.args.length > 0) {
        addParamToResult(arg);
      } else {
        result.push({
          field: arg.left,
          param: arg.right && arg.right.startsWith(':') ? arg.right.substr(1) : arg.left,
          value: arg.right && arg.right.startsWith(':') ? '' : arg.right
        });
      }
    }
  };
  addParamToResult(expression);
  result.forEach(function(r) { r.value = r.value.split("'").join('"'); }.bind(this));
  return result;
};

StimulsoftHelper.prototype.mergeQueryParams = function(linkParameters, queryParams) {

  if (!linkParameters.params) {
    var expression = linkParameters;
    linkParameters = {};
    linkParameters.expression = expression;
    linkParameters.params = [];
  }

  queryParams.forEach(function (qp) {
    var exist = false;
    for (var i = 0; i < linkParameters.params.length; i++) {
      if (linkParameters.params[i].fieldName == qp.fieldName) {
        exist = true;
        break;
      }
    }
    if (!exist)
      linkParameters.params.push(qp);
  }.bind(this));
  return linkParameters;
};

StimulsoftHelper.prototype.buildQueryString = function(data, returnType) {
  var odataParsed = '';
  var paramsParsed = '';
  var queryString;

  if (data.params) {
    paramsParsed = this.parseParams(data.params)
    odataParsed = window.parserOdata(data.expression);
  }
  else {
    odataParsed = window.parserOdata(data);
  }

  queryString = paramsParsed;
  if (odataParsed.length > 0) {
    if (queryString.length > 0)
      queryString += '&$filter=' +  odataParsed;
    else
      queryString = '$filter=' + odataParsed;
  }

  if (returnType == 'odata')
    return odataParsed;
  if (returnType == 'param')
    return paramsParsed;
  else
    return queryString;
};

StimulsoftHelper.prototype.parseParams = function(params) {
  var queryString = [];
  if (params) {
    params.forEach(function (p) {
      queryString.push(p.fieldName + '=' + this.parseParamValue(p.fieldValue));
    }.bind(this));
  }
  return queryString.join('&');
};

StimulsoftHelper.prototype.parseParamValue = function (value) {
  var result = '';
  if (value != null) {
    if (value.startsWith(':')) {
      result = value;
    }
    else {
      result = eval(value);
      if (result instanceof Date) {
        result = result.toISOString();
      }
    }
  }
  return result;
};

StimulsoftHelper.prototype.setParamsInFilter = function(dataSources, datasourcesParam) {
  datasourcesParam.forEach(function(datasourceP) {
    var datasource = this.findDatasourceByName(dataSources, datasourceP.name);
    datasource.originalSqlCommand = datasource.sqlCommand;

    //Convert o linkParameters para o sqlCommand
    var linkParameters = this.manageLinkParameters('get', datasource);
    var linkParametersJson = {};
    if (linkParameters.length)
      linkParametersJson = JSON.parse(linkParameters);

    linkParametersJson = this.mergeQueryParams(linkParametersJson, datasourceP.queryParams);
    var odata = this.buildQueryString(linkParametersJson, 'odata');
    var param = this.buildQueryString(linkParametersJson, 'param');

    datasourceP.fieldParams.forEach(function(fp) {
      var paramValueOData = this.adjustParam.bind(this)(fp, 'odata');
      var paramValueQS = this.adjustParam.bind(this)(fp, 'param');
      var regex = eval('/' + ':' + fp.param + '\\b/gim');

      odata = odata.replaceAll(regex, paramValueOData);
      param = param.replaceAll(regex, paramValueQS);
    }.bind(this));

    var queryString = param;
    if (odata.length > 0) {
      odata = '$filter=' + odata;
      if (queryString.length > 0)
        queryString += '&' + odata;
      else
        queryString = odata;
    }

    this.manageLinkParameters('set', datasource, queryString);

  }.bind(this));
};

StimulsoftHelper.prototype.manageLinkParameters = function(operation, datasource, conditionToSet) {

  var condition = '';
  var queryName = datasource.sqlCommand;
  var idxQues = datasource.sqlCommand.indexOf('?');
  if (idxQues > -1) {
    condition = datasource.sqlCommand.substr(idxQues + 1);
    queryName = datasource.sqlCommand.substr(0, idxQues);
  }
  if (operation == 'get') {
    return condition;
  }
  else if (operation == 'set') {
    datasource.sqlCommand = queryName;
    if (conditionToSet && conditionToSet.length > 0)
      datasource.sqlCommand += '?' + conditionToSet;
  }
  return '';
};

StimulsoftHelper.prototype.restoreOriginalFilter = function(dataSources, datasourcesParam) {
  datasourcesParam.forEach(function(datasourceP) {
    var datasource = this.findDatasourceByName(dataSources, datasourceP.name);
    if (datasource.originalSqlCommand)
      datasource.sqlCommand = datasource.originalSqlCommand;
  });
};

StimulsoftHelper.prototype.getColumnByName = function(datasource, name) {
  var columns = datasource.columns.toList();
  var column = null;
  for (var i = 0; i < columns.length; i++) {
    if (columns[i].name == name) {
      column = columns[i];
      break;
    }
  }
  return column;
};

StimulsoftHelper.prototype.getQueryName = function(datasource) {

  var queryName = datasource.sqlCommand;
  var idxQues = datasource.sqlCommand.indexOf('?');
  if (idxQues > -1) {
    queryName = datasource.sqlCommand.substr(0, idxQues);
  }
  return queryName;
};

StimulsoftHelper.prototype.getDatasourcesInBand = function(report) {
  var datasourcesInBands = { hasParam: false, datasources: [] };
  if (report.pages && report.pages.list && report.pages.list.length > 0) {
    //Itera as paginas e descobre as bands e datasources associados
    var pages = report.pages.toList();
    pages.forEach(function(p)  {
      var components = p.components.toList();
      components.forEach(function (c) {

        if (c.dataSourceName) {
          var datasource = this.findDatasourceByName(report.dictionary.dataSources, c.dataSourceName);
          if (datasource) {
            var ds = {
              name: datasource.name,
              customId: this.getQueryName(datasource),
              fieldParams: this.getParamsFromFilter(datasource)
            };
            if (ds.fieldParams.length > 0) datasourcesInBands.hasParam = true;
            datasourcesInBands.datasources.push(ds);
          }
        }

      }.bind(this));
    }.bind(this));
  }
  return datasourcesInBands;
};

StimulsoftHelper.prototype.overrideMethods = function() {

  //Os js são carregados assincronamente, faz o override apenas quando todos os js do stimulsoft estiverem carregados.
  Stimulsoft.Base.StiODataHelper.prototype.getDefaultWebClient = function () {
    var client = {};
    if (!String.isNullOrWhiteSpace(this.addressBearer)) {
      if (String.isNullOrWhiteSpace(this.bearerAccessToken)) {
        this.bearerAccessToken = Stimulsoft.Base.StiODataHelper.getBearerAccessToken(this.addressBearer, this.userName, this.password);
      }
    }
    client.downloadString = function (address, userName, password, bearerAccessToken) {
      try {
        var request = new XMLHttpRequest();

        if (!String.isNullOrWhiteSpace(userName) && String.isNullOrWhiteSpace(bearerAccessToken)) {
          request.withCredentials = true;
          request.open("Get", address, false, userName, password);
        }
        else {
          if (!String.isNullOrWhiteSpace(bearerAccessToken)) {
            request.setRequestHeader("Authorization", "Bearer " + bearerAccessToken);
          }
          request.open("Get", address, false);
        }

        if (window.uToken) {
          request.setRequestHeader("X-AUTH-TOKEN", window.uToken);
        }
        request.send();
        if (request.status == 200) {
          return request.responseText;
        }
      }
      catch (e) {
        throw e;
      }
    };
    return client;
  };

};

var stimulsoftHelper = new StimulsoftHelper();